  "firParkText" : MessageLookupByLibrary.simpleMessage(''' En 1650, la Merchants’s House acheta le terrain, qui faisait partie du domaine de Wester Craigs, maintenant connu sous le nom de Glasgow Necropolis. Comme le côté ouest était rocheux et ne pouvait pas être développé, il a ensuite été planté de sapins et est devenu connu sous le nom de Fir Park. Cependant, en 1804, les sapins écossais du parc ont commencé à mourir et ont été remplacés principalement par des ormes et des saules et la région est devenue un parc et un arboretum victoriens. En 1825, la première pierre du monument John Knox a été posée à Fir Park.
'''),
  "design" : MessageLookupByLibrary.simpleMessage(''' La conception de la nécropole de Glasgow 
'''),
  "designText1" : MessageLookupByLibrary.simpleMessage(''' En 1831, John Strang, chambellan à la maison des marchands, écrivit «Necropolis Glasguensis» ou «Réflexions sur la mort et la stimulation morale» et commenta:
'''),
  "designTextItalics" : MessageLookupByLibrary.simpleMessage('''”Le parc à sapins semble admirablement adapté pour un père la chaise, qui s'harmoniserait magnifiquement avec le paysage adjacent, et constituerait un appendice solennel et approprié à la structure vénérable (la cathédrale) devant laquelle, tout en offrant un logement très recherché aux classes supérieures, transformerait en même temps un bien improductif en une source de profit générale et lucrative, en une institution caritative "il devait être" respectueux des morts, sûrs et sanitaires pour les vivants, dédié au Génie de Mémoire et étendre le sentiment religieux et moral."
'''),
  "designText2" : MessageLookupByLibrary.simpleMessage(''' La maison des marchands a demandé à l'architecte David Hamilton, Stuart Murray, conservateur des jardins botaniques et James Clelland, surintendant des travaux publics, de produire une étude de faisabilité pour la formation de la nécropole de Glasgow et en 1828, le comité des directeurs des terres et carrières a accepté La proposition. En 1831, un concours pour convertir le parc à sapins en cimetière avec 5 prix de 10 à 50 livres sterling fut annoncé dans les journaux. Seize plans ont été reçus et mis en exposition dans les salles d’exposition de la société Dilettante à Argyll Arcade. David Bryce d'Edimbourg a remporté le premier prix et son frère John Bryce de Glasgow le deuxième. Les juges ont toutefois décidé que le travail serait mieux entrepris par un jardinier paysagiste. En conséquence, George Mylne a été nommé surintendant et jardinier en chef et les travaux ont commencé.
'''),
  "victorian" : MessageLookupByLibrary.simpleMessage(''' La nécropole victorienne de Glasgow 
'''),
  "victorianText" : MessageLookupByLibrary.simpleMessage(''' Ce cimetière a toujours été destiné à être interconfessionnel et le premier enterrement en 1832 a été celui d'un juif, Joseph Levi, un bijoutier. En 1833, la première sépulture chrétienne fut celle d'Elizabeth Miles, belle-mère du surintendant, George Mylne. Après 1860, les premières extensions à l'est et au sud devaient reprendre la carrière de Ladywell et en 1877 et 1892/3, les dernières extensions au nord et au sud-est ont été construites, doublant ainsi la taille du cimetière. La nécropole est maintenant de 37 acres (15 ha).
                 
50 000 enterrements ont eu lieu à la Nécropole et la plupart des 3 500 tombes ont été construites jusqu'à 14 pieds de profondeur, avec des murs en pierre et des cloisons en briques. Au sommet de la nécropole, des tombes ont été projetées hors de la paroi rocheuse. En 1877, le Molendinar Burn, qui passait sous le pont des Soupirs, a été poncé. Cette brûlure dans laquelle St Mungo aurait pêché le saumon est maintenant souterraine en route vers la Clyde.
                 
La nécropole était l'un des rares cimetières à tenir des registres des morts, y compris la profession, l'âge, le sexe et la cause du décès. En juillet 1878, le livre des visiteurs montre que 13 733 personnes ont visité la nécropole de Glasgow - 12 400 citoyens et 1 333 autres visiteurs.
                 
En 1966, la Merchants’s House a donné la Nécropole au Glasgow City Council qui l’administre et la maintient. Les bancs et les abords des tombes ont été enlevés et la majeure partie de la zone a été mise en herbe à des fins d'entretien. Il y a ici des monuments conçus par de grands architectes et sculpteurs de l'époque, dont Alexander «Greek» Thomson, Charles Rennie Macintosh et JT Rochead, dans tous les styles architecturaux, créés pour les entrepreneurs éminents et riches de la «deuxième ville de l'Empire».
                 
La nécropole de Glasgow a toujours une atmosphère merveilleuse et attire toujours de nombreux visiteurs à la fois localement et de partout dans le monde. 
'''),
